import casebody from './case-body.png';
import './App.css';

function CaseStudies() {
  return (
          <div className="container CaseStudies-body">   
                <div data-content-for="content">
                    <a href='/' target="_blank">
                        <div data-content-for="content-overlay">
                           <img  className='content-image' src={casebody} alt='case-study-placeholder' />
                        </div>
                        <div className="content-details">
                            <p style={{ fontSize: "1.5rem" }} data-mce-style={{ fontSize: "2.94444rem", lineHeight: "3rem"}}className='tagline overtext'>
                                <span> Egwu Records is a platform for discovering music of yesterday today. Egwu allows people create playlists about old artistes, write reviews about old albums and exchange, buy and trade records.</span>
                            </p>
                        </div> 
                    </a>
                </div>    
            </div>
  );
}

export default CaseStudies;
